150 gram yumuşamış tereyağı
1 çay bardağı nişasta
1 çay bardağı pudra şekeri
Yarım çay bardağı sıvıyağ
1 buçuk y kaşığı yoğurt
1 yumurta
1 paket kabartma tozu
1 paket şekerli vanilin
3 veya 3 buçuk su bardağı un
..
İç malzemeleri
3 tane elma
3 yemek kaşığı şeker
1 silme yemek kaşığı tarçın
..
Yapılışı
Elmaların kabuklarını soyup rendeleyin. Tavada şekerini ekleyip kavurun. Yumuşadıktan sonra tarçını ekleyip ocağı kapatın. Hamur için un hariç tüm malzemeleri karıştırın azar azar un ekleyip yoğurun. Hamuru 3/4 parçaya bölün. Videodaki gibi açın ve bıçakla kesikler atıp elmalı harcı ekleyin. Sonra yavaşca kurabiyeleri kesin. 190 dereceye ayarladığımız fırında pembeleşinceye kadar pişirin. Şimdiden afiyet olsun 🍪🥰👌☺️🌸
